    false,nt"url": null,nt"notes": "This annual narrative report for Mason
    Neck National Wildlife Refuge outlines Refuge accomplishments during the 1979 calendar
    year. The report begins with an introduction to the Refuge and information about
    climate conditions, habitat conditions, land acquisition, and system status. Refuge
    construction and maintenance are also described. Habitat management is covered;
    wetlands and forestlands are discussed. The wildlife section of the report discusses
    endangered and threatened species, migratory birds, mammals, and big game animals.
    Interpretation and recreation activities are outlined; topics include information
    and interpretation, recreation, and law enforcement. Field investigations, cooperative
    programs, items of interest, and safety are discussed. Photographs are attached.",nt"license_title":
